import React from 'react';
import '../css/contact.css';

function formatName(user) {
    return user.firstName + ' ' + user.lastName;
  }

  const user = {
    firstName: 'Kylian',
    lastName: 'boussaid'
  };

  const element = (
    <h1>
      yo, {formatName(user)} !  </h1>
  );

  ReactDOM.render(
    element,
    document.getElementById('root')
  );
  export default formatName
